defs.script:
let apmaster = 0,
  bank = 0,
  calculatedValue,
  pitch = 0,
  hdgtext = 0,
  config = {},
  currentalt = 0,
  ap = 0,
  apaltlock = 0,
  hdg = 0,
  aphdglockdir = 0,
  aphdglock = 0,
  closeHdgLockDirBox,
  selectedaltitudereached = false;


window.parent.addEventListener("update", eventHandler, true);

function eventHandler(update) {
  Update(update.detail);
}

var path = window.parent.location.pathname.split('/');
path.pop();
path = path.join("/") + "/";
fetchAsync(window.parent.location.pathname + '/config.json')
  .then(data => {
    config = data;
    return true;
  })
  .catch(reason => console.log("Error in config.json:\n" + reason))

function addMarker(item, index) {
    marker = d3.select('#ias-ruler').append("svg:g").attr("transform","translate(5," + item.value * -12.364 + ")").attr("id","iasMarker-" + item.type)
    marker.append("svg:path").attr("d","m 218.6751,358.68181 h 37.3004 v 29.8004 h -37.3004 l -13.6972,-14.9002 z")
    marker.append("svg:text").attr("x","235").attr("y","382").text(item.type)
}

function init(){

  if (config.AIRSPEED_INDICATED?.markers?.length > 0 ) {
    config.AIRSPEED_INDICATED.markers.forEach(addMarker)

    d3.select('#ias-ruler-yellow-bar')
      .attr('height',(config['AIRSPEED_INDICATED'].yellowbarend - config['AIRSPEED_INDICATED'].yellowbarstart) * 12.364)
      .attr('y',(373.74-(config['AIRSPEED_INDICATED'].yellowbarend)*12.364))
    d3.select('#ias-ruler-green-bar')
      .attr('height',(config['AIRSPEED_INDICATED'].greenbarend - config['AIRSPEED_INDICATED'].greenbarstart) *12.364)
      .attr('y',373.5-(config['AIRSPEED_INDICATED'].greenbarend)*12.364)
    d3.select('#ias-ruler-flaps-full-bar')
      .attr('height',(config['AIRSPEED_INDICATED'].whitebarend - config['AIRSPEED_INDICATED'].whitebarstart) *12.364)
      .attr('y',-373.5-(config['AIRSPEED_INDICATED'].whitebarend - config['AIRSPEED_INDICATED'].whitebarstart-config['AIRSPEED_INDICATED'].whitebarend)*12.364)
  }

  calculatedValue = config.calculatedValue ? config.calculatedValue : 0;
}

function Update(inputObject){
  for(let attr = 0; attr < Object.keys(inputObject).length; attr++){
    let key = Object.keys(inputObject)[attr];
    let value = Object.values(inputObject)[attr] ;
    value = (/^\d.*\.*\d$/.test(calculatedValue) ? eval(calculatedValue.replace("x",value)) : value);

    switch (key.toUpperCase()) {

      case 'AUTOPILOT_MASTER':
        apmaster = value;
        if (aphdglock && apmaster) {
          d3.select('#ap-selected-hdg-bug').style('display','block');
          d3.select('#ap-hdg-active-sign').style('display','block');
          d3.select('#hdg-lock-indicator').style('display','block');
        } else {
          d3.select('#ap-selected-hdg-bug').style('display','none');
          d3.select('#ap-hdg-active-sign').style('display','none');
          d3.select('#hdg-lock-indicator').style('display','none');
        }
       if (apaltlock && apmaster) {
          d3.select('#ap-selected-alt').style("display","block");
          d3.select('#ap-alt-active-sign').style("display","block");
        } else {
          d3.select('#ap-selected-alt').style("display","none");
          d3.select('#ap-alt-active-sign').style("display","none");
        }


        break;

      case 'PLANE_BANK_DEGREES':
        bank = value;
        d3.select('#bank-indicator').attr('transform', 'rotate('+bank+', 500, 373.5)');
        //d3.select('#horizon-gradient').attr('gradientTransform','translate(0 '+pitch+'), rotate('+bank+' 500, 373.5)')
        //d3.select('#pitch-ruler-fade-out-top').attr('gradientTransform','translate(0 '+pitch+'), rotate('+bank+' 500, 373.5)')
        break;

      case 'PLANE_PITCH_DEGREES':
        pitch = (value*1>180) ? (value-360)*-1 : value * - 1;
        d3.select('#horizon-gradient').attr('gradientTransform', 'rotate('+bank+', 500, 373.5) translate(0, '+pitch * 22.825+')');
        d3.select('#pitch-ruler-fade-out-top').attr('gradientTransform','translate(0 '+pitch+'), rotate('+bank+' 500, 373.5)')
        d3.select('#pitch-ruler-fade-out-top').attr('gradientTransform','translate(0 '+pitch+'), rotate('+bank+' 500, 373.5)')
        d3.select('#pitch-ruler').attr('transform', 'rotate('+bank+', 500, 373.5) translate(0, '+pitch*22.825+')');
        break;

      case 'INDICATED_ALTITUDE':
        currentalt = value;
        if (value > 1000) {
            d3.select('#alt-value-thousands').text(Math.floor(value/1000));
            d3.select('#alt-value-hundreds').text(('00' + Math.round(value)%1000).slice(-3));
        } else {
            d3.select('#alt-value-thousands').text('');
            d3.select('#alt-value-hundreds').text((Math.floor(value)%1000));
        }
        d3.select('#alt-ruler-complete').attr('transform','translate(0,' + value * 1.8545 + ')')
        d3.select('#ap-selected-alt').attr('transform','translate(0,' + (currentalt*1 + apaltlock*1) * 1.8545 + ')')

        if (Math.abs(value + apaltlock) <= 30) {
          d3.select('#ap-alt-value').style('fill','#0bbbbb')
          selectedaltitudereached = true;
        }
        if (Math.abs(value + apaltlock) > 200 && selectedaltitudereached) {
          d3.select('#ap-alt-value').style('fill','yellow')   // selected ap alt deviation warning
        }
        break;

      case 'AUTOPILOT_ALTITUDE_LOCK_VAR':
        if (apaltlock !== value *-1) {
          selectedaltitudereached = false;
          d3.select('#ap-alt-value').style('fill','#0bbbbb')
        }
        apaltlock = value*-1;
        d3.select('#ap-alt-value').text(Math.round(value));
        break;

      case 'AUTOPILOT_ALTITUDE_LOCK':
        if (value && apaltlock && apmaster) {
          d3.select('#ap-selected-alt').style("display","block");
          d3.select('#ap-alt-active-sign').style("display","block");
        } else {
          d3.select('#ap-selected-alt').style("display","none");
          d3.select('#ap-alt-active-sign').style("display","none");
        }
        break;

      case 'GPS_GROUND_SPEED':
        d3.select('#gs-value').text(Math.round(value));
        break;

      case 'AIRSPEED_INDICATED':
        d3.select('#ias-value tspan').text(Math.round(value));
        d3.select('#ias-ruler').attr('transform','translate(0,'+value*12.364+')')
        break;

      case 'KOHLSMAN_SETTING_MB':
        d3.select('#baro-value').text(value.toFixed(0));
        break;


      case 'PLANE_HEADING_DEGREES_MAGNETIC':
        value === 0 ? 360 : value;
        hdgtext = Math.abs(Math.floor(value % 360));
        if (value < 0) {
          hdgtext = 360 - Math.abs(Math.floor(hdgtext));
        }
        d3.select('#hdg-ruler').attr('transform', 'translate(' + Math.round(0 - value * 15.4) + ', 300)');
        d3.select('#ap-selected-hdg-bug').attr('transform', 'translate(' + ((value - aphdglockdir) * -15.4) + ', 0)');
        d3.select('#hdg-value').text(hdgtext);
        break;

      case 'AUTOPILOT_HEADING_LOCK_DIR':
        if (value !== aphdglockdir) {
          clearTimeout(closeHdgLockDirBox);
          aphdglockdir = Math.floor(value);
          d3.select('#ap-hdg-selected-value').text(aphdglockdir + 'Â°');
          d3.select('#ap-hdg-selected-box').style('display', 'block');
          closeHdgLockDirBox = setTimeout(function(){
            d3.select('#ap-hdg-selected-box').style('display','none');
          }, 3000);
        }
        break;

      case 'AUTOPILOT_HEADING_LOCK':
        aphdglock = value;
        if (value && aphdglockdir && apmaster) {
          d3.select('#ap-selected-hdg-bug').style('display','block');
          d3.select('#ap-hdg-active-sign').style('display','block');
          d3.select('#hdg-lock-indicator').style('display','block');
        } else {
          d3.select('#ap-selected-hdg-bug').style('display','none');
          d3.select('#ap-hdg-active-sign').style('display','none');
          d3.select('#hdg-lock-indicator').style('display','none');
        }
        break;

      case 'TURN_COORDINATOR_BALL':
        d3.select('#slip-indicator-ball').attr('transform', 'translate('+Math.round(value*1.2)+ ', 0)');
        break;

      case 'NAV_1_CDI':
        d3.select('#cdi').attr('transform', 'translate('+value * 1.07 +', 0)');
        break;

      case 'NAV_1_GSI':
        d3.select('#gsi').attr('transform', 'translate(0, '+value * 0.96+')');
        break;

      case 'VERTICAL_SPEED':
        d3.select('#vsi').attr('height', Math.abs(value * 0.0752));
        value = value > 0 ? value * -0.0752 + 746 : 746;
        d3.select('#vsi').attr('transform', 'translate(0, ' + value + ')');
        break;

      default:
        //console.log('       :-(    Attribute '+key+' not relevant for this element... Ignoring');
    };
  }
}
